import React from "react";
import logo from "./logo.svg";
import "./App.css";
import background from "./me-and-taz.jpeg"

function App() {
  return (
    <div className="App">
      <div className="App-header Background-Image">
      <img src={background} />
        <p className="maintitle">I Am</p>
        <p className="main"></p>
        <p>Additional content goes below</p>
      </div>
    </div>
  );
}

export default App;
